import React from 'react';
import './header.css'
import imgas from '../images/Annotation 2024-01-23 201729.png';
import { BrowserRouter as Router, Route, Switch ,useHistory} from 'react-router-dom';
import Login from '../../pages/lgoin/Login';
import { Link } from 'react-router-dom/cjs/react-router-dom';

function Headers(props) {
  const history = useHistory()
  const handleClick = () => {
    history.push('/jjj');
  };
  return (
    <>
      <div className='header-contaier'>
        <p className='appName'><a href='/home'>Photogram</a></p>
        
        <img className='HeaderImg'src={imgas} onClick={()=> handleClick}/>
        <div className=''>
          <ul>
            <li >
              <span className='material-symbols-outlined' >add_photo_alternate</span>
              <Router>
                <Link to="/add-post">Add</Link>
              </Router>
            </li>
            <li>
              <span className='material-symbols-outlined'>post</span>
              <Router>
                <Link to="/all-post">post</Link>
              </Router>
            </li>
            <li>
              <span className='material-symbols-outlined'>login</span>
              <Router>
                <Link to="/login">Login</Link>
              </Router>
            </li>
          </ul>
        </div>
      </div>
    </>
  )
}

export default Headers
